.meteor-helper {
  height: 25px;
  display: none;
}
.meteor-helper .panel-heading {
  background-color: #161719;
  background-image: none;
  padding: 0 15px;
  height: 26px;
}
.meteor-helper .panel-heading .meteor-logo {
  width: 76px;
  height: 25px;
  background-position: 5px 0;
  background-repeat: no-repeat;
  background-size: 100px 17px;
  background-image: url("atom://meteor-helper/assets/meteor_logo.svg");
}
.meteor-helper .panel-heading .status-bar-right {
  margin-top: 5px;
  width: 18px;
  height: 18px;
  text-align: center;
}
.meteor-helper .panel-heading .status-bar-right span.icon-check:before,
.meteor-helper .panel-heading .status-bar-right span.icon-alert:before,
.meteor-helper .panel-heading .status-bar-right span.icon-gear:before {
  text-align: center;
  margin: 0;
  padding: 0;
  border: 0;
  font-size: 14px;
  line-height: 14px;
  width: 14px;
  height: 14px;
}
.meteor-helper .panel-body {
  margin: 0 15px;
  padding-bottom: 25px;
  overflow-x: hidden;
  overflow-y: auto;
  height: inherit;
  min-height: 2rem;
}
.meteor-helper .panel-body h3 {
  padding-top: 2px;
  padding-left: 4px;
  margin: 0;
}
.meteor-helper .panel-body .meteor-details {
  padding-top: 5px;
  padding-left: 4px;
  margin: 0;
}
.meteor-helper .panel-body p {
  margin: 0;
}
